import React from "react";

const Coustomer = ({ cuslist }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>S.No</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Views</th>
        </tr>
      </thead>
      <tbody>
        {cuslist.map((customer, index) => (
          <tr key={index}>
            <td>{index + 1}</td>
            <td>{customer.name}</td>
            <td>{customer.phone}</td>
            <td>{customer.pending_flag}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Coustomer;
